// React
import React, { Fragment } from "react";

// Third part
import { Table, Divider } from "antd";
import { DeleteFilled, EditFilled } from "@ant-design/icons";

const { Column } = Table;

const PersonalTable = ({
  data,
  colOne,
  colTwo,
  colThird,
  colFourth,
  colFive,
  deleteItem,
  editItem
}) => {
  const onFilter = (value, record) => {
    record[0].firstname.indexOf(value) === 0;
  };
  return (
    <Table bordered dataSource={data} rowKey={data => data.id}>
      <Column
        title={colOne}
        render={(value, record) => onFilter(value, record)}
      />
      <Column title={colTwo} dataIndex={colTwo} />
      <Column title={colThird} dataIndex={colThird} />
      <Column title={colFourth} dataIndex={colFourth} />
      <Column
        key={data => data.id}
        title={colFive}
        render={(text, record) => (
          <Fragment>
            <DeleteFilled
              className="btn btn-danger"
              onClick={() => deleteItem(record.id)}
            />

            <Divider type="vertical" />
            <EditFilled
              className="btn btn-primary"
              onClick={() => editItem(record)}
            />
          </Fragment>
        )}
      />
    </Table>
  );
};

export default PersonalTable;
